    "from sklearn.model_selection import GridSearchCV\n",
    "from sklearn.metrics import make_scorer, mean_squared_error\n",
    "\n",
    "# Define a range of values for n_estimators\n",
    "n_estimators_range = range(50, 501, 50)  # from 50 to 500 with a step of 50\n",
    "\n",
    "# Create a dictionary for the parameter grid\n",
    "param_grid = {'regressor__n_estimators': n_estimators_range}\n",
    "\n",
    "# Create a custom scoring function for RMSE\n",
    "def rmse_scorer(y_true, y_pred):\n",
    "    return np.sqrt(mean_squared_error(y_true, y_pred))\n",
    "\n",
    "# Create GridSearchCV object\n",
    "grid_search = GridSearchCV(\n",
    "    estimator=full_model,  # The pre-processing and ML model\n",
    "    param_grid=param_grid,\n",
    "    scoring=make_scorer(rmse_scorer),  # Use RMSE as the scoring metric\n",
    "    cv=5  # 5-fold cross-validation\n",
    ")\n",
    "\n",
    "# Fit the grid search to the training data\n",
    "grid_search.fit(X_train, y_train)\n",
    "\n",
    "# Get the best parameters\n",
    "best_params = grid_search.best_params_\n",
    "\n",
    "# Optionally, you can also refit the model with the best parameters on the full training set\n",
    "best_model = grid_search.best_estimator_\n",
    "\n",
    "# Predict on the validation set and evaluate performance\n",
    "y_val_pred = best_model.predict(X_val)\n",
