    "from pyswarm import pso\n",
    "\n",
    "# Define the objective function for PSO\n",
    "def objective(params):\n",
    "    n_estimators = int(params[0])\n",
    "    max_features_index = int(params[1])\n",
    "    min_samples_split = int(params[2])\n",
    "    min_samples_leaf = int(params[3])\n",
    "    \n",
    "    max_features_options = [1.0, 'sqrt', 'log2']  # replace 'auto' with 1.0\n",
    "    max_features = max_features_options[max_features_index]\n",
    "    \n",
    "    model = FullModel(\n",
    "        n_estimators=n_estimators,\n",
    "        max_features=max_features,\n",
    "        min_samples_split=min_samples_split,\n",
    "        min_samples_leaf=min_samples_leaf\n",
    "    )\n",
    "    \n",
    "    model.fit(X_train, y_train)\n",
    "    y_pred = model.predict(X_val)\n",
    "    \n",
    "    return np.sqrt(mean_squared_error(y_val, y_pred))\n",
    "    \n",
    "lower_bounds = [50, 0, 2, 1]\n",
    "upper_bounds = [500, 2, 10, 4]\n",
    "\n",
    "# Define the FullModel class\n",
    "class FullModel:\n",
    "    def __init__(self, n_estimators=100, max_features=1.0, min_samples_split=2, min_samples_leaf=1):\n",
    "        self.regressor = RandomForestRegressor(\n",
    "            n_estimators=n_estimators,\n",
    "            max_features=max_features,\n",
    "            min_samples_split=min_samples_split,\n",
    "            min_samples_leaf=min_samples_leaf\n",
    "        )\n",
    "\n",
    "    def fit(self, X, y):\n",
    "        self.regressor.fit(X, y)\n",
    "\n",
    "    def predict(self, X):\n",
    "        return self.regressor.predict(X)\n",
    "\n",
    "# Perform PSO\n",
    "best_params, best_score = pso(objective, lower_bounds, upper_bounds, swarmsize=20, maxiter=50)\n",
    "\n",
    "# Convert the best parameters to their respective types\n",
    "best_n_estimators = int(best_params[0])\n",
    "best_max_features_index = int(best_params[1])\n",
    "best_max_features = [1.0, 'sqrt', 'log2'][best_max_features_index]\n",
    "best_min_samples_split = int(best_params[2])\n",
    "best_min_samples_leaf = int(best_params[3])\n",
    "\n",
    "# Train the final model with the best parameters\n",
    "best_model = FullModel(\n",
    "    n_estimators=best_n_estimators,\n",
    "    max_features=best_max_features,\n",
    "    min_samples_split=best_min_samples_split,\n",
    "    min_samples_leaf=best_min_samples_leaf\n",
    ")\n",
    "best_model.fit(X_train, y_train)\n",
    "\n",
    "# Predict on the validation set and evaluate performance\n",
    "y_val_pred = best_model.predict(X_val)\n",
    "val_rmse = np.sqrt(mean_squared_error(y_val, y_val_pred))\n",
    "val_r2 = r2_score(y_val, y_val_pred)\n",
    "\n",
    "# Print the best parameters and scores\n",
    "print(\"Best parameters found: \", {\n",
